import "./App.css";
import Nav from "./components/Nav";
import About from "./components/About";
import {BrowserRouter ,Route, Switch } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
    <div className="App">
      <Nav />
      <Switch>
        <Route exact path="/about" component={About} />
      </Switch>
    </div>
    </BrowserRouter>
  );
}

export default App;
